USE SIST_CARROS;


-----------------------------------------------------------------------------------------------

  SELECT marca
  FROM base2
  GROUP BY marca;

---------------------------------------------------------------------------------------------
 
	SELECT
		b.modelo,
		m.id_marca
	FROM
		base2 b
		INNER JOIN marca m ON m.marca = b.marca
	GROUP BY b.modelo, m.id_marca;

-----------------------------------------------------------------------------------------------

  SELECT acessorio
  FROM base2
  GROUP BY acessorio;

-----------------------------------------------------------------------------------------------
  
	SELECT
		ma.id_marca,
		mo.id_modelo,
		b.descricao,
		a.id_acessorio,
		CAST(REPLACE(b.preco, ".", "") as UNSIGNED) as preco
	FROM
		base2 b
		INNER JOIN modelo mo ON b.modelo = mo.modelo
		INNER JOIN marca ma ON mo.id_marca = ma.id_marca
		INNER JOIN acessorio a ON a.acessorio = b.acessorio;
